import axios from "axios";

const url = "http://localhost:8000/";

export const login = async (data) => {
  try {
    const res = await axios({
      method: "post",
      data,
      headers: { Authorization: null },
      url: `${url}api/users/signup`,
    });
    console.log(res);
    return res;
  } catch (e) {
    console.log("e", e);
    return e;
  }
};
